BMW X3 sDrive 18d con Paquete M Sport

El coche tiene solo 3 años (fecha de matriculación 09/2021) y se vende por haber pedido un coche nuevo.

Tiene un montón de extras como:

-Paquete M Sport; 
-Paquete aerodinámico M
-Suspensión M Sport;
-Llantas de 20 inch; 
-Volante M de cuero;
-Techo de cristal panorámico deslizante; 
-Asientos deportivos; 
-Asientos de piel en color cognac; 
-Ventanas traseras blindados; 
-Paquete conectivity; 
-Paquete travel;
-Paquete connected profesional;
-Control por gestos; 
-Luz ambiente;
-Parking assistant Plus;
-Faros de antiniebla LED;
-Molduras exteriores M en negro brillo,

Y muchas opciones más.

De momento tiene aprox 84.000km y esta disponible a partir de finales de Octubre. 

Visitas y reserva posible a partir de lunes 09/09/24.
